import React from 'react';
import Blog from '../Content/Blog';
import Gallery from '../Content/Gallery';
import Footer from '../Footer/Footer';
import TopNavbar from '../Header/TopNavbar';

const Index = () => {
  return (
    <>
        <TopNavbar/>
        <Blog/>
        <Footer/>
    </>
  )
}

export default Index
